__NUXT_JSONP__("/", (function(a,b,c,d,e,f,g,h,i,j,k,l,m,n,o,p,q){return {data:[{document:{slug:"index",description:"Create your own datacenter at home and get paid in monero",title:"Introduction",position:1,category:"Getting started",toc:[{id:g,depth:h,text:i},{id:j,depth:h,text:k}],body:{type:"root",children:[{type:a,tag:e,props:{},children:[{type:b,value:"The masternetwork is a project that allows computer to execute python scripts for developpers. The computer that execute the python script are paid in monero in exchange."}]},{type:b,value:c},{type:a,tag:l,props:{id:g},children:[{type:a,tag:f,props:{ariaHidden:m,href:"#how-the-masternetwork-works-",tabIndex:n},children:[{type:a,tag:o,props:{className:[p,q]},children:[]}]},{type:b,value:i}]},{type:b,value:c},{type:a,tag:e,props:{},children:[{type:b,value:"\nSome scripts, like scrapping algorithms required to be executed from multiple location. "},{type:a,tag:d,props:{},children:[]},{type:b,value:"\nDeveloppers can send to our website their code, they define a number of repetition, a price per second of execution (in monero)."},{type:a,tag:d,props:{},children:[]},{type:b,value:"\nThey fill their account in monero by sending to their subadress some monero (a subadress is generated at the creation of the account).\n"},{type:a,tag:d,props:{},children:[]},{type:b,value:c},{type:a,tag:d,props:{},children:[]},{type:b,value:"\nOn the other hand, you can get monero by executing python scripts of the developpers. \nYou can see how to make your computer work for you "},{type:a,tag:"nuxt-link",props:{to:"\u002Finstallation"},children:[{type:b,value:"here"}]},{type:a,tag:d,props:{},children:[]},{type:a,tag:d,props:{},children:[]},{type:b,value:"\nThe python scripts will run in a docker container, so there is no risk that a malicious script access your computer data.\n"}]},{type:a,tag:e,props:{},children:[{type:b,value:"The monero collected will be credited in your account, then you will be able to trigger a transfer to your adress."}]},{type:b,value:c},{type:a,tag:e,props:{},children:[]},{type:b,value:c},{type:a,tag:"img",props:{src:"https:\u002F\u002Fwww.reactiongifs.us\u002Fwp-content\u002Fuploads\u002F2015\u002F02\u002Fexplain_like_im_five_office.gif"},children:[]},{type:b,value:c},{type:a,tag:l,props:{id:j},children:[{type:a,tag:f,props:{ariaHidden:m,href:"#is-the-masternetwork-live-",tabIndex:n},children:[{type:a,tag:o,props:{className:[p,q]},children:[]}]},{type:b,value:k}]},{type:b,value:c},{type:a,tag:e,props:{},children:[{type:b,value:"\nYeah ! We may have scalability issue in the future but for now it is working well !\n"},{type:a,tag:d,props:{},children:[]},{type:b,value:"\nJoin our "},{type:a,tag:f,props:{rhef:"https:\u002F\u002Fdiscord.gg\u002FxbwUHXfgtu"},children:[{type:b,value:"Discord"}]},{type:b,value:" to talk about technical issues and what we can improve for the masternetwork.\n"}]}]},dir:"\u002Fen",path:"\u002Fen\u002Findex",extension:".md",createdAt:"2022-01-09T08:48:12.000Z",updatedAt:"2022-02-22T00:15:53.263Z",to:"\u002F"},prev:null,next:{title:"Retrieve your password \u002FHacking\u002F",path:"\u002Fen\u002Fpassword",to:"\u002Fpassword"}}],fetch:{},mutations:[]}}("element","text","\n","br","p","a","how-the-masternetwork-works-",2,"How the masternetwork works ?","is-the-masternetwork-live-","Is the masternetwork live ?","h2","true",-1,"span","icon","icon-link")));